fields.info_text:
{"de": "**Brandschutzrelevante Vorhaben**

Für alle brandschutzrelevanten Vorhaben ist ein Brandschutznachweis einzureichen.  Ein Brandschutznachweis besteht grundsätzlich aus dem Nachweis (Textteil) und den Brandschutzplänen. Eine entsprechende Anleitung ist auf [www.brandschutznachweis.ch]  (https://www.brandschutznachweis.ch/de/vorlagen-arbeitshilfen) zu finden .

Bei Vorhaben wo lediglich Schutzabstände betroffen sind, kann allenfalls ein vereinfachter Brandschutznachweis (vermasster Situationsplan mit Darlegung der Massnahmen gemäss BSR 15-15 Ziffer 2.4) eingereicht werden.", "fr": null}

{"de": "**Dossier ID**

Für jedes Dossiers welches auf URec erfasst wird, vergibt das System automatisch eine ID Nummer (vier- oder fünfstellige zusammenhängende Zahl). Die ID Nummer ist nicht zu verwechseln mit der URec Nummer welche erst vergeben wird, wenn die Gemeindebaubehörde ein online eingereichtes Dossier als vollständig erarchtet und dieses annimmt. Die URec Nummer besteht aus der Gemeindenummer-dem Jahr-und einer fortlaufenden, dreistelligen Zahl, z.B. 1201-21-005).

Über die ID Nummer wird dieses Dossier automatisch mit dem von Ihnen ausgewählten Dossier bzw. mit dem bereits laufenden Bewilligungs- oder Meldeverfahren verknüpft.", "fr": null}

fields.static_content:
{"de": "---

#### Druckbehälter
Die Art der Druckbehälter, deren Lage im Betrieb bzw. auf dem Betriebsareal, sowie Inhalt, Betriebsdruck und Mengenangaben müssen entweder in den Plänen ersichtlich sein oder mittels einer separaten Liste deklariert werden.", "fr": ""}

fields.info_text:
{"de": "####INFO

EGID ist die eidgenössische Gebäudeidentifikationsnummer gemäss dem Gebäude- und Wohnungsregister des Bundesamtes für Statistik (BfS)

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null}

{"de": "####INFO

EWID ist die eigenössische Wohnungsidentifikationsnummer im Gebäude - und Wohnungsregister des Bundesamtes für Statistik (AfS).

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null}

fields.static_content:
{"de": "#### Ex-Zonen
Der Lagerort, die Menge und die Art von ätzenden, brand-oder explosionsgefährlichen Stoffen muss in den Plänen ersichtlich sein. Falls notwendig, erstellen Sie bitte ein entsprechendes Konzept, woraus auch die Belüftung der Lagerräume von Ex-Zonen und deren Überwachung aufgezeigt wird. 

Details zum Thema Ex-Zonen können dem SUVA Merkblatt 2153 „Explosionsschutz. Grundsätze, Mindestvorschriften, Zonen“ entnommen werden.", "fr": ""}

{"de": "#### Angaben zur Gebäudehülle
Materialien und Farbgebung der Fassade, der Gebäudeöffnungen (Fenster und Türen) und der Bedachung. Bei umfangreichen Projekten (z.B. Gesamtüberbauungen, grössere Bauten und Anlagen, Bauten in sensiblen Gebieten wie Kern- und/oder Ortsbildschutzzonen) bitten wir Sie, ein Farbkonzept einzureichen.

In diesem Zusammenhang verweisen wir auf das Merkblatt [Farbgebung in Ortsbildern und in der Landschaft](https://www.ur.ch/_docn/187162/Merkblatt_Farbgebung_in_Ortsbildern_und_in_der_Landschaft_Version_2.pdf)", "fr": ""}

{"de": "---

#### Förderanlagen
Hinweise zu Förderanlagen sind in den Normen SN EN 619 "Stetigförderer und Systeme - Sicherheits- und EMV-Anforderungen an mechanische Fördereinrichtungen für Stückgut" und SN EN 620 "Stetigförderer und Systeme - Sicherheits- und EMV-Anforderungen für ortsfeste Gutförderer für Schüttgut" sowie in den Suva-Checklisten 67022 und 67024 enthalten.", "fr": ""}

fields.info_text:
{"de": "Raumplanungsverordnung
Art. 32a Bewilligungsfreie Solaranlagen

1 Solaranlagen gelten als auf einem Dach genügend angepasst (Art. 18a Abs. 1 RPG), wenn sie:

a. die Dachfläche im rechten Winkel um höchstens 20 cm überragen;
b. von vorne und von oben gesehen nicht über die Dachfläche hinausragen;
c. nach dem Stand der Technik reflexionsarm ausgeführt werden; und
d. als kompakte Fläche zusammenhängen.

2 Konkrete Gestaltungsvorschriften des kantonalen Rechts sind anwendbar, wenn sie zur Wahrung berechtigter Schutzanliegen verhältnismässig sind und die Nutzung der Sonnenenergie nicht stärker einschränken als Absatz 1.

3 Bewilligungsfreie Vorhaben sind vor Baubeginn der Baubewilligungsbehörde oder einer anderen vom kantonalen Recht für zuständig erklärten Behörde zu melden. Das kantonale Recht legt die Frist sowie die Pläne und Unterlagen, die der Meldung beizulegen sind, fest.", "fr": null}

{"de": "Zusätzliche Information

Wenn die gesetzlich festgelegten Grenzabstände unterschritten werden, muss gleichzeitig mit dem Baugesuch auch ein entsprechendes  Näherbaurecht vorgelegt werden.

Zudem kann infolge einer Verminderung eines Grenzabstandes auch der Gebäudeabstand derart vermindert werden dass das Vorhaben brandschutzrelevant wird.", "fr": null}

fields.static_content:
{"de": "**Gebäudetechnik**

Die Angaben zur Wärmequelle und zum Wärmeerzeuger für Heizung und Warmwasser sind je nach Art des Vorhabens zwingender Bestantteil einer Baueingabe. **Bitte erfassen Sie für alle gebäudetechnischen Anlagen jeweils einen separaten Datensatz** (z.B. für die Wärmequelle der Hauptheizung, für die Wärmequelle der Zusatzheizung und, falls vorgesehen auch für die Solaranlage usw.).

Für die nachträgliche Erfassung bzw. Meldung von gebäudetechnischen Angaben verwenden Sie bitte das Formular "MELDUNG GEBAUEDETECHNIK".", "fr": ""}

{"de": "Bitte erfassen Sie die geplante/n Solar- und/oder Photovoltaikanlage/n mit der Tabelle unten (es können mehrere Datensätze erfasst werden). 

Weitere Informationen zur Baubewilligungspflicht von Solaranlagen können Sie dem [Merkblatt "Baugesuche einreichen"](https://www.ur.ch/_docn/187159/Merkblatt_Baugesuche_einreichen_Version_1.2.pdf) entnehmen.

---", "fr": ""}

{"de": "**Hinweis zur Meldung von Solaranlagen**
Bitte verwenden Sie für die Meldung einer thermischen oder photovoltaischen Solaranlage das separate Formular "MELDUNG SOLARANLAGE".

Das Formular "MELDUNG SOLARANLAGE" ist so aufgebaut, dass je nach Art und Lage der Anlage und unter der Voraussetzung, dass die Fragen korrekt beantwortet werden, bereits im Formular geklärt wird, ob eine Baubewilligung notwendig ist. Wenn dies der Fall ist, werden Sie im Formular darauf hingewiesen, für die Meldung der Solaranlage das Formular „Baugesuch“ zu verwenden.", "fr": ""}

{"de": "**Wichtige Hinweise**

- Parkplätze mit mehr als 300 Stellplätzen sind UVP pflichtig.

- Grundsätzlich ist bei allen Parkierungsanlagen zu prüfen, ob und wie viele behindertengerechte Parkplätze erstellt werden müssen.", "fr": ""}

{"de": "---

#### Innerbetriebliche Emissionen

**Lärm und Erschütterungen:** Gebäude und Gebäudeteile müssen so gestaltet sein, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Arbeitsmittel müssen so gestaltet sein, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Arbeitsabläufe und Produktionsverfahren müssen so gestaltet und durchgeführt werden, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Zum Schutz der Arbeitnehmer sind insbesondere folgende Vorkehrungen zu treffen: 

- a. bauliche Massnahmen; 
- b. Massnahmen an Betriebseinrichtungen; 
- c. Isolation oder örtliche Abtrennung der Lärmquelle; 
- d. Massnahmen der Arbeitsorganisation.

**Raumakustischer Nachweis:** Für sämtliche Arbeitsräume mit Arbeitsplätzen sowie für Ess- und Aufenthaltsräume ist die Mindestanforderung an die Raumakustik zu erfüllen. Dabei muss die Bedingung einer der drei folgenden Richtwertvarianten erfüllt sein:

- Schallabsorptionskoeffizient αs > 0,25
- Nachhallzeit T in Funktion des Raumvolumens nach Tabelle 322-3 der SECO-Wegleitung zu Art. 22 ArGV3, SR 822.113
- Schalldruckpegelabnahme pro Distanzverdoppelung DL 2 ≥ 4 dB Weitere Infos siehe [suva.ch/laerm](https://www.suva.ch/laerm).", "fr": ""}

{"de": "**Bitte beachten:** Die Tiefbauten sind in zwei Kategorien unterteilt. Analog wie bei den Hochbauten können beliebig viele Tiefbauanlagen erfasst werden. 

- **Tiefbauten-Siedlung:** Diese Art von Tiefbauten wie z.B. Parkplätze, Veloabstellplätze oder Angaben zu den Anschlüssen wie Wasser, Abwasser usw. werden in der Regel im Zusammenhang mit einem Hochbauprojekt erstellt. 
- **Tiefbauten-Landschaft:** Diese Art von Tiefbauten wie Terrainveränderungen, Erschliessungen usw. werden in der Regel einzel als Bauprojekt eingereicht und folglich auch einzeln erfasst.", "fr": ""}

fields.info_text:
{"de": "#### INFO
Bei künstlicher Lüftung oder Klimatisierung ist ein Lüftungskonzept beizulegen (Art, Anzahl Luftwechsel und weitere technische Angaben, CO₂ Werte beachten).

Bitte geben Sie im dafür vorgegebenen Textfeld an, welche Räumlichkeiten künstlich belüftet bzw. klimatisiert werden.", "fr": null}

{"de": "####INFO

Mehrgeschossige Wohnung

Gibt an, dass die Wohnung über mehrere Stockwerke gebaut ist (Maisonette)", "fr": null}

{"de": "#### INFO
Je nachdem, welche Themenbereiche Sie unter "Projekt Energienachweis" auswählen, werden die Links zu den entsprechenden EN Zusatzformularen angezeigt.

Bitte füllen Sie die entsprechneden Formulare aus und laden Sie diese bei den Dokumenten hoch (bezeichnen Sie die Dokumente bitte mit dem offiziellen Kürzel, z.B. EN-1a).", "fr": null}

{"de": "#### INFO
Die Auswahl "Art der Arbeiten" nimmt einerseits Bezug auf das gesamte Bauprojekt. Wenn Sie also im Rahmen eines Bauprojekts sowohl Neubauten als auch Umbauten erstellen und wenn allenfalls im gleichen Bauprojekt auch Gebäude abgebrochen werden, können Sie auch mehrere Varianten gleichzeitig auswählen.

Andererseits erscheint die gleiche Abfrage auch unter der Rubrik "Hochbau" in der Tabelle "Gebäude und Anlagen". Dies deshalb, weil je nach Bauprojekt den Gebäuden allenfalls unterschiedliche bauliche Massnahmen zugeordnet werden müssen.", "fr": null}

fields.static_content:
{"de": "##Energienachweis

Ein Energienachweis ist in der Regel notwendig bei beheizten oder gekühlten Neubauten, Umbauten, Erweiterungen und Zweckänderungen, oder wenn in der Gebäudehülle einzelne Bauteile ersetzt, oder neu gedämmt werden. Ebenfalls notwendig ist der Nachweis, wenn gebäudetechnische Anlagen wie Heizungen, Lüftungen, Klima- und/oder Kälteanlagen ersetzt oder neu eingebaut werden. Bitte wählen Sie die entsprechenden baulichen Umstände aus, die bei Ihrem Vorhaben zutreffen.

Im Zweifelsfall kontaktieren Sie bitte zur Klärung der Notwendigkeit eines Energienachweises direkt das [Amt für Energie](https://www.ur.ch/_rte/amt/828).", "fr": ""}

fields.info_text:
{"de": "#### INFO
Auf Dächern in Bau-und Landwirtschaftszonen bedürfen genügend angepasste Solaranlagen keiner Baubewilligung. Solche Vorhaben sind lediglich der zuständigen Gemeindebaubaubehörde  zu melden (Art. 22 RPG). Solaranlagen die die technischen Voraussetzungen gemäss Artikel 32a RPV nicht erfüllen sind jedoch baubewilligungspflichtig. Ebenfalls baubewilligungspflichtig sind Solaranlagen die an Fassaden oder Balkonbrüstungen montiert werden oder freistehende, im Gelände installierte Anlagen. Bei solchen Anlagen bitten wir Sie, das Formular "Baugesuche" zu verwenden.

Bitte beachten Sie auch die rechtlichen und nutzungsplanerischen Voraussetzungen, die ebenfalls je nach Situation zur Baubewilligungspflicht führen.", "fr": null}

fields.static_content:
{"de": "**Tankanlagen** zur Lagerung von wassergefährdenden Flüssigkeiten ab 450 Liter Nenninhalt sind bewilligungspflichtig. Eine Tankanlage darf erstellt werden sobald eine Tankbewilligung vorliegt. Sie darf jedoch erst befüllt bzw. in Betrieb genommen werden wenn auch die Tankvignette vorliegt. Weitere Angaben für die Bewilligung von Tankanlagen entnehmen Sie bitte der [Vollzugshilfe der KVU](https://www.kvu.ch/de/themen/tankanlagen).

*Für Tankanlagen ab 450 Liter ist zwingend auch ein Brandschutzplan (Grundrissplan) mit den erforderlichen Brandschutzmassnahmen gemäss den schweizerischen Brandschutzvorschriften einzureichen.*

Weitere Angaben entnehmen Sie bitte der [Brandschutzrichtlinie 26-15](https://www.bsvonline.ch/).", "fr": ""}

{"de": "**Wichtiger Hinweis**
Die Gemeindebaubehörde entscheidet bei separat eingereichten Meldungen betreffend die Änderung oder Neuinstallation von Gebäudetechnik, bei denen kein Baubewilligungsverfahren läuft bzw. wenn dieses allenfalls bereits abgeschlossen ist, ob für die Bewilligung der geplanten Anlage ein ordentliches Baubewilligungsverfahren durchzuführen ist. Dies kann zum Beispiel dann der Fall sein, wenn durch die Installation einer neuen Abgasanlage das äussere Erscheinungsbild einer Baute verändert wird.

**Meldung Solaranlage** für die Meldung einer photovoltaischen oder thermischen Solaranlage verwenden Sie bitte das Formular "Meldung Solaranlage"", "fr": ""}

